  \"2013-07-19T16:00:23.301986\",\n\t\"name\": \"parabolic-dunes-landform-features-of-iowa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A landscape is a collection of land shapes
  or land forms. Landform Regions are a grouping of individual landscape features
  that have a common geomophology. In Iowa, these regions are composed of earth materials
  derived from glacial, wind, river, and marine environments of the geologic past.
  This is a new representation of the Landforms of Iowa. These landforms represent
  different geomorphologic landscapes, and the geologic processes that have created
  them. Parabolic Dunes are eolian sand features that are oriented with the nose in
  the downwind direction, in the case of these dunes, that is southeast. It is believed
  that these dunes formed during the late Pleistocene, with activation into the Holocene.
  Parabolic dunes form when Dunes, have blow-out conditions and the sides are anchored
  with vegetation, but not the downwind-side, and the front of the dune migrates downwind.\",\n\t\"license_title\":
